import React from "react";
import logo from '../../../assets/logo.png'
const Header = () =>{
    return (
<>
<header className='header'>
    <div className='container flex'>
       <div className='logo'>
          <img src={logo} alt=''></img>
       </div>
    </div>
</header>
</>
    )
    }
export default Header;
